import { ReactComponent as MainImage } from 'assets/images/homepage.svg';
import ButtonIcon from 'components/ButtonIcon';
import TestChildren from 'components/TestChildren';
import { Link } from 'react-router-dom';
import { isAuthenticated } from 'util/requests';
import './styles.css';

const Home = () => {
  return (
    <>
      <div className="home-container">
        <TestChildren price={234.56}>
          <h1> Conteudo 1</h1>
          <h1> onteudo 2</h1>
        </TestChildren>

        <h1>{isAuthenticated() ? 'autenticado' : 'Não autenticado'}</h1>
        <div className="base-card home-card">
          <div className="home-content-container">
            <div>
              <h1>Patologias na construção</h1>
              <p>
                Repositório de informação sobre as causas, abordagens, aplicação
                de materiais e tratamento.
              </p>
            </div>
            <div>
              <Link to="/edificios">
                <ButtonIcon text="Iniciar busca" />
              </Link>
            </div>
          </div>
          <div className="home-image-container">
            <MainImage />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
